import React, { Component } from 'react';
import Home from '../Home/home';
import Navbar from '../Navbar/nav';
import Main from '../Main/Main'

class Header extends React.Component {
    render() {
        return (
            <div>
                <header className="App-header">
                    <Home/>
                    <Navbar/>
                </header>
                <Main/>
            </div>
        )}
    }

export default Header;
